import React from 'react';

function MyComponent({ items }) {
  return (
    <div className="container text-right">
	    <div className="row">
	      {items.map((item, index) => (
	        <div className={(index > 0 && index%3==0)? "col" : ""}>
	          hello
	        </div>
	      ))}
	    </div>
    </div>
  );
}

export default MyComponent;
